	readConfigServers: function (_key) {
		return new Promise(
			function (resolve, reject) {
				try {
					_FUNCTIONS.LoadDataAjax("/Abstract/GetConfigServers").then(function (data) {
						var _item = data.find(item => item.key === _key);
						resolve(_item);
					});
				} catch (rex) {
					reject(rex);
				}
			}
		);
	},

	preventDefaultsOver: function (e) {
		$('.drop-area').addClass("drag-over");
		e.preventDefault();
		e.stopPropagation();
	},
	preventDefaultsEnter: function (e) {
		e.preventDefault();
		e.stopPropagation();
	},
	preventDefaultsLeave: function (e) {
		$('.drop-area').removeClass("drag-over");
		e.preventDefault();
		e.stopPropagation();
	},
	handleDrop: function (e) {
		e.preventDefault();
		for (var i = 0; i < e.dataTransfer.files.length; ++i) {
			var reader = new FileReader();
			var _file = e.dataTransfer.files[i];
			if (_FUNCTIONS.allowedTypes.includes(_file.type)) {
				reader.readAsDataURL(_file);
			} else {
				alert("Tipo de archivo incorrecto.  Por favor revise su selección y vuelva a intentar.");
			}
			reader.onload = _FUNCTIONS.drawImage;
		}
	},
	handleDrop2: function (e) {
		e.preventDefault();
		for (var i = 0; i < e.dataTransfer.files.length; ++i) {
			var reader = new FileReader();
			var _file = e.dataTransfer.files[i];
			if (_file.size > (_FUNCTIONS._max_filesize_upload * 1024000)) {
				alert("Se aceptan archivos de hasta " + _FUNCTIONS._max_filesize_upload + "mb");
				return false;
			}
			if (_FUNCTIONS.allowedTypes.includes(_file.type)) {
				reader.readAsDataURL(_file);
			} else {
				alert("Tipo de archivo incorrecto.  Por favor revise su selección y vuelva a intentar.");
			}
			reader.onload = _FUNCTIONS.drawImage2;
		}
	},
	drawImage: function (e) {
		var _base64 = e.target.result;
		var _mime = _base64.split(";")[0].split(":")[1];
		var _style = "width:50%;";
		switch (_mime) {
			case "application/pdf":
				_style = "width:100%;";
				break;
		}
		$(".preview").append("<embed class='fileLoaded' type='" + _mime + "' src='" + _base64 + "' style='" + _style + "'/>");
		$('.drop-area').removeClass("drag-over");
		$(".drop-area").css({ "border-color": "#ccc" });
	},
	drawImage2: function (e) {
		var _base64 = e.target.result;
		$(".preview").attr("src", _base64);
		$(".base64").val(_base64);
		$('.drop-area').removeClass("drag-over");
		$(".drop-area").css({ "border-color": "#ccc" });
	},
	LoadComboJson: function (_data, _control, _selected) {
		return new Promise(
			function (resolve, reject) {
				try {
					var _value = _selected;
					var _target = ("#" + _control);
					var _id = $(_target).attr("data-id");
					var _descripcion = $(_target).attr("data-descripcion");
					$(_target).css({ "opacity": 0.5, "color": "red" });
					var _sel = "";
					var _empty = $(_target).attr("data-empty");
					$(_target).empty();
					if (_value == -1 || _value == "") { _sel = "selected"; }
					if (_empty != "N") { $(_target).append('<option ' + _sel + ' value="">[Seleccione]</option>'); }
					$.each(_data, function (i, item) {
						_sel = "";
						if (_value == item[_id]) {
							$(_target.replace("#", ".")).val(_selected);
							_sel = "selected";
						}
						$(_target).append('<option ' + _sel + ' value="' + item[_id] + '">' + item[_descripcion] + '</option>');
					});
					$(_target).css({ "opacity": 1, "color": "black" });
					resolve(_data);
				} catch (rex) {
					reject(rex);
				}
			}
		);
	},

	LoadComboAjax: function (_url, _control, _selected) {
		return new Promise(
			function (resolve, reject) {
				try {
					var _value = _selected;
					var _target = ("#" + _control);
					var _id = $(_target).attr("data-id");
					var _descripcion = $(_target).attr("data-descripcion");
					$(_target).css({ "opacity": 0.5, "color": "red" });
					var xhttp = new XMLHttpRequest();
					xhttp.open('GET', _url, false);
					xhttp.onreadystatechange = function () {
						if (xhttp.readyState == 4 && xhttp.status == 200) {
							var _data = JSON.parse(xhttp.responseText);
							var _sel = "";
							var _empty = $(_target).attr("data-empty");
							$(_target).empty();
							if (_value == -1 || _value == "") { _sel = "selected"; }
							if (_empty != "N") { $(_target).append('<option ' + _sel + ' value="">[Seleccione]</option>'); }
							$.each(_data, function (i, item) {
								_sel = "";
								if (_value == item[_id]) {
									$(_target.replace("#", ".")).val(_selected);
									_sel = "selected";
								}
								$(_target).append('<option ' + _sel + ' value="' + item[_id] + '">' + item[_descripcion] + '</option>');
							});
							$(_target).css({ "opacity": 1, "color": "black" });
							resolve(_data)
						};
					};
					xhttp.send();
				} catch (rex) {
					reject(rex);
				}
			}
		);
	},
	LoadDatalistAjax: function (_url, _control, _field) {
		return new Promise(
			function (resolve, reject) {
				try {
					var xhttp = new XMLHttpRequest();
					xhttp.open('GET', _url, false);
					xhttp.onreadystatechange = function () {
						if (xhttp.readyState == 4 && xhttp.status == 200) {
							var _data = JSON.parse(xhttp.responseText);
							$(_control).html("");
							$.each(_data, function (i, item) { $(_control).append('<option>' + item[_field] + '</option>'); });
							resolve(_data);
						};
					};
					xhttp.send();
				} catch (rex) {
					reject(rex);
				}
			}
		);
	},
	ExecutePostAjax: function (_url, _params) {
		return new Promise(
			function (resolve, reject) {
				try {
					$.ajax({
						type: "POST",
						url: _url,
						data: _params,
						dataType: "json",
						encode: true,
						success: function (data) {
							resolve(data);
						},
						error: function (xhr, ajaxOptions, thrownError) {
							reject(thrownError);
						}
					});
				} catch (rex) {
					reject(rex);
				}
			}
		)
	},
	LoadDataAjax: function (_url) {
		return new Promise(
			function (resolve, reject) {
				try {
					setTimeout(function () {
						var xhttp = new XMLHttpRequest();
						xhttp.open('GET', _url, false);
						xhttp.onreadystatechange = function () {
							if (xhttp.readyState == 4 && xhttp.status == 200) {
								if (xhttp.responseText != "") {
									resolve(JSON.parse(xhttp.responseText));
								} else {
									resolve(null);
								}
							};
						};
						xhttp.send();
					}, 10);
				} catch (rex) {
					reject(rex);
				}
			}
		)
	},

