	SavePosY: function (y, top) {
		localStorage.setItem('scrollpos', y);
		if (top) { window.scrollTo(0, 0); }
	},
	RestorePosY: function () {
		var scrollpos = localStorage.getItem('scrollpos');
		if (scrollpos) { window.scrollTo(0, scrollpos); }
	},
	BuildTable: function (_params, _hidden) {
		var _id = "";
		if (_params.idKey != undefined && _params.idKey != "") { _id = _params.idKey; }
		if (_params.new == undefined || _params.new == "") { _params.new = false; }
		if (_params.edit == undefined || _params.edit == "") { _params.edit = false; }
		if (_params.delete == undefined || _params.delete == "") { _params.delete = false; }
		if (_params.verify == undefined || _params.verify == "") { _params.verify = false; }
		if (_params.one == undefined || _params.one == "") { _params.one = false; }

		if (_params.one) {
			if (_params.records != null) {
				if (_params.records.length != 0) {
					_params.new = false;
				}
			}
		}

		var _html = "";
		_html += "<table class='" + _params.class + "'>";
		_html += "   <thead>";
		_html += "      <tr>";
		if (_params.new) { _html += "<th><a href='#' class='btn btn-sm btn-primary btnNewModal " + _hidden + "' data-interface='" + _params.interface + "' data-id='0'>+Nuevo</a></th>"; } else { _html += "<th></th>"; }
		_html += "         <th></th>";
		for (var i = 0; i < _params.labels.length; i++) { _html += ("<th>" + _params.labels[i] + "</th>"); }
		_html += "         <th></th>";
		_html += "      </tr>";
		_html += "   </thead>";
		_html += "   <tbody>";
		if (_params.records != null) {
			if (_params.records.length != 0) { }
			for (var i = 0; i < _params.records.length; i++) {
				var _style = "";
				var _offline = false;
				var _verified = false;
				var _icon = "verified";
				var _rec = _TOOLS.utf8_to_b64(JSON.stringify(_params.records[i]));
				if (_params.records[i]["offline"] != undefined) { _offline = (_params.records[i]["offline"] != ""); }
				if (_params.records[i]["verified"] != undefined) { _verified = (_params.records[i]["verified"] != ""); }
				if (_verified) { _style = "color:green;font-weigth:bold;background-color:ivory;"; }
				if (_offline) { _style = "color:red;font-style:italic;background-color:silver;"; _icon = "block"; }
				if (!_params.edit) { _icon = ""; }
				if (!_offline) {
					_html += ("   <tr style='" + _style + "'>");
					if (_params.edit && !_offline) { _html += ("<td><a href='#' data-record='" + _rec + "' class='btn btn-sm btn-secondary btnEditModal " + _hidden + "' data-interface='" + _params.interface + "' data-id='" + _params.records[i][_id] + "'>Editar</a></td>"); } else { _html += "<td></td>"; }
					if (_params.verify && !_verified && !_offline) {
						_html += ("<td><a href='#' class='btn btn-sm btn-success btnVerifyModal " + _hidden + "' data-interface='" + _params.interface + "' data-id='" + _params.records[i][_id] + "'>Verificar</a></td>");
					} else {
						if (_verified) {
							_html += "<td><i class='material-icons'>" + _icon + "</i></td>";
						} else {
							_html += "<td></td>";
						}
					}
					for (var x = 0; x < _params.fields.length; x++) {
						_html += ("<td>" + _params.records[i][_params.fields[x]] + "</td>");
					}
					if (_offline) {
						_html += ("<td>offline: " + _params.records[i]["offline"] + "</td>");
					} else {
						if (_params.delete) { _html += "<td><a href='#' class='btn btn-sm btn-danger btnDeleteModal " + _hidden + "' data-interface='" + _params.interface + "' data-id='" + _params.records[i][_id] + "'>Dar de baja</a></td>"; } else { _html += "<td></td>"; }
					}
					_html += "   </tr>";
				}
			}
		}
		_html += "   </tbody>";
		_html += "</table>";
		return _html;
	},
