								if (_scoring[_FUNCTIONS._lastPlanIndex]["Minimo"] == null || _scoring[_FUNCTIONS._lastPlanIndex]["Minimo"] == "") { _scoring[_FUNCTIONS._lastPlanIndex]["Minimo"] = 0; }
